import Player from "./Player";
import classes from "./Admin.module.css";
import Act from "./Act";

export default function StaffList({ staffData, user, selectedServer }) {
  return (
    <div className={classes.staffList}>
      <button className={classes.addUser}>Добавить пользователя</button>
      {staffData.map((staffPlayer) => {
        return (
          <Player
            key={staffPlayer.id}
            playerData={staffPlayer}
            user={user}
            selectedServer={selectedServer}
          />
        );
      })}
    </div>
  );
}
